import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import "./../styles/Home.css";
import defaultProfileIcon from "./../assets/defaultProfileIcon.png"; // Add a default profile icon image

const Home = () => {
  const navigate = useNavigate();
  const [user, setUser] = useState(null);

  useEffect(() => {
    // Simulate fetching user data from localStorage or API
    const storedUser = JSON.parse(localStorage.getItem("user"));
    setUser(storedUser);
  }, []);

  const handleLoginRedirect = () => {
    if (!user) {
      navigate("/login");
    }
  };

  const handleArtisanRedirect = () => {
    if (user) {
      if (user.role === "Artisan") {
        navigate("/artisan/dashboard");
      } else {
        alert("You need to log in as an Artisan.");
      }
    } else {
      alert("Please log in first.");
      navigate("/login");
    }
  };

  const handleConsumerRedirect = () => {
    if (user) {
      if (user.role === "Consumer") {
        navigate("/consumer/dashboard");
      } else {
        alert("You need to log in as a Consumer.");
      }
    } else {
      alert("Please log in first.");
      navigate("/login");
    }
  };

  return (
    <div className="home-container">
      {/* Navigation Bar */}
      <nav className="navbar">
        <div className="navbar-left">
          <button onClick={() => navigate("/")}>Home</button>
          <button onClick={() => navigate("/events")}>Upcoming Art Events</button>
          <button onClick={() => navigate("/our-artisans")}>Our Artisans</button>
        </div>
        <div className="navbar-right">
          {user ? (
            <img
              src={user.profilePicture || defaultProfileIcon}
              alt="Profile"
              className="profile-icon"
              onClick={() => navigate("/profile")}
            />
          ) : (
            <button onClick={handleLoginRedirect}>Login</button>
          )}
        </div>
      </nav>

      {/* Hero Section */}
      <div className="hero-section">
        <h1 className="hero-title">Artisan's Connect</h1>
        <p className="hero-tagline">Connecting Artisans to the World!</p>
      </div>

      {/* Mini Pages */}
      <div className="mini-page artisan-section">
        <div className="mini-page-content">
          <h2>Create and Sell Your Arts</h2>
          <p>Join our platform to showcase your creativity and sell your handmade products.</p>
          <button onClick={handleArtisanRedirect}>Get Started as Artisan</button>
        </div>
        <div className="mini-page-image artisan-image"></div>
      </div>

      <div className="mini-page consumer-section">
        <div className="mini-page-image consumer-image"></div>
        <div className="mini-page-content">
          <h2>Learn Art and Explore Products</h2>
          <p>Discover unique handmade products and learn from talented artisans.</p>
          <button onClick={handleConsumerRedirect}>Get Started as Consumer</button>
        </div>
      </div>

      {/* Consumer Reviews */}
      <div className="reviews-section">
        <h2>Consumer Reviews</h2>
        <p>See what our consumers are saying about our platform and artisans.</p>
        {/* Add reviews dynamically here */}
      </div>

      {/* Footer */}
      <footer className="footer">
        <p>&copy; 2025 Artisan's Connect. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default Home;
